import styled from 'styled-components';



export const Container = styled.div`
    display:flex;
    flex-flow: row wrap;
    justify-content:center;
    margin-top:35px;
    margin:0;

`

export const AnnouncementsContainer = styled.div`
    width:500px;

`
export const Background = styled.div`
    background: #A3BDA7;
    border-radius:20px;
    margin:20px;
    padding:20px;   
    `

    export const Button = styled.button`
    border-radius:25px;
    padding: 5px 10px;
    font-family: Monsterrat, sans-serif;
    background: #d3dbd3;
    border:none;
    font-size:18px;
`

export const AddButtonDiv = styled.div`
    display:flex;
    justify-content:center;
    padding:20px;
`
